 font-size: 1.4em; color: #707070;
}

}

}

}

h4 {

}

h5 {

}

h6 {

}


a:visited {
   color: rgb(50%, 0%, 50%);
}


body {
      font-size:6.8pt;
      max-width:100%;
   }

   a, a:visited {
      text-decoration: underline;
   }
}
